import React, { useState } from 'react';
import './App.css';

function App() {
  const [num1, setNum1] = useState('');
  const [num2, setNum2] = useState('');
  const [result, setResult] = useState(null);
  const [tableData, setTableData] = useState([]);
  const [error, setError] = useState('');

  const calculateGCD = () => {
    setError('');
    setResult(null);
    setTableData([]);

    const a1 = parseInt(num1, 10);
    const a2 = parseInt(num2, 10);

    if (!a1 || !a2 || a1 <= 0 || a2 <= 0) {
      setError('양의 정수 두 개를 입력하세요.');
      return;
    }

    // C 코드와 같이 큰 수를 첫번째로, 작은 수를 두번째로 설정
    let first, second;
    if (a1 > a2) {
      first = a1;
      second = a2;
    } else {
      first = a2;
      second = a1;
    }

    // 1번 인덱스부터 사용 (0번 인덱스는 더미)
    let r = [];
    let q = [];
    let s = [];
    let t = [];
    r[1] = first;
    r[2] = second;
    q[1] = 0;
    s[1] = 1;
    s[2] = 0;
    t[1] = 0;
    t[2] = 1;

    let n = 1, d = 0;
    // 배열에 저장된 각 단계 정보를 저장할 테이블 배열
    let table = [];

    // 첫 단계 정보
    table.push({
      iteration: 1,
      q: q[1],
      r_n: r[1],
      r_n1: r[2],
      r_n2: r[3] !== undefined ? r[3] : 'N/A',
      s: s[1],
      t: t[1],
    });

    while (true) {
      q[n + 1] = Math.floor(r[n] / r[n + 1]);
      r[n + 2] = r[n] % r[n + 1];
      s[n + 2] = s[n] - q[n + 1] * s[n + 1];
      t[n + 2] = t[n] - q[n + 1] * t[n + 1];

      // 저장 전 현재 단계의 정보 추가
      table.push({
        iteration: n + 1,
        q: q[n + 1],
        r_n: r[n],
        r_n1: r[n + 1],
        r_n2: r[n + 2],
        s: s[n],
        t: t[n],
      });

      if (r[n + 2] === 0) {
        n = n + 1;
        d = r[n + 1];
        // 마지막 행 (계산 결과 행) 추가
        table.push({
          iteration: n + 1,
          q: 'N/A',
          r_n: r[n + 1],
          r_n1: r[n + 2],
          r_n2: 'N/A',
          s: s[n + 1],
          t: t[n + 1],
        });
        break;
      }
      n++;
    }

    // 최종 결과: r[1]를 first, r[2]를 second, 그리고 s[n]과 t[n]을 이용하여 표현
    const finalS = s[n];
    const finalT = t[n];
    setResult({
      gcd: d,
      equation: `${d} = ${first} * (${finalS}) + ${second} * (${finalT})`
    });
    setTableData(table);
  };

  return (
    <div className="App">
      <header className="App-header">
        <h2>확장 유클리드 알고리즘 계산기</h2>
        <div>
          <input
            type="number"
            placeholder="정수 1"
            value={num1}
            onChange={(e) => setNum1(e.target.value)}
          />{' '}
          <input
            type="number"
            placeholder="정수 2"
            value={num2}
            onChange={(e) => setNum2(e.target.value)}
          />
          <button onClick={calculateGCD}>계산하기</button>
        </div>
        {error && (
          <p style={{ color: 'red' }}>{error}</p>
        )}
        {result && (
          <div>
            <h3>결과</h3>
            <p>gcd({num1}, {num2}) = {result.gcd}</p>
            <p>{result.equation}</p>
          </div>
        )}
        {tableData.length > 0 && (
          <div style={{ overflowX: 'auto', marginTop: '20px' }}>
            <h3>계산 단계</h3>
            <table border="1" cellPadding="5">
              <thead>
                <tr>
                  <th>n</th>
                  <th>q(n)</th>
                  <th>r(n)</th>
                  <th>r(n+1)</th>
                  <th>r(n+2)</th>
                  <th>s(n)</th>
                  <th>t(n)</th>
                </tr>
              </thead>
              <tbody>
                {tableData.map((row, index) => (
                  <tr key={index}>
                    <td>{row.iteration}</td>
                    <td>{row.q}</td>
                    <td>{row.r_n}</td>
                    <td>{row.r_n1}</td>
                    <td>{row.r_n2}</td>
                    <td>{row.s}</td>
                    <td>{row.t}</td>
                  </tr>
                ))}
              </tbody>
            </table>
          </div>
        )}
      </header>
    </div>
  );
}

export default App;
